class PeopleUser extends Component {
    render() {
        return (
            <div className="cat-title mac-flex">
                <div>
                    <img src={icon1} />
                    <a href>Dành cho nam</a>
                </div>
                <div>
                    <img src={icon2} />
                    <a href>Dành cho nử</a>
                </div>
                <div>
                    <img src={icon3} />
                    <a href>Cặp đôi</a>
                </div>
                <div className="sort-list">
                    <select className="order-select">
                        <option value>Sắp xếp theo</option>
                        <option value />
                        <option value />
                        <option value />
                        <option value />
                    </select>
                </div>
            </div>


        )
    }
}
export default PeopleUser;
